const Home = () => {
    const { isLoggedIn } = useSelector((state) => state.user);
    const { mainPosts } = useSelectpr((state) => state.post.mainPosts);
    return (
        <AppLayout>
            <PostForm />
            <PostCard />
        </AppLayout>
    );
}

export default Home;
